import { Fragment } from "react";
import './App.css';
import Logo from './img/Logo.png'
import { Link, Route, Routes } from "react-router-dom";

// import Icon from '@mui/material/Icon';

function App() {
  return (
    <Fragment>
      <header className="header">
        <div className="navbar">
          <img className="navbar__logo" src={Logo} alt="logo" />
          <input type="search" className="navbar__search" />
          <select>
            <option>
              1
            </option>
            <option>
              2
            </option>
            <option>
              3
            </option>
          </select>

          <Link to={"/"} className="header__menu-link">Become an Mentor</Link>
        </div>

      </header>
    </Fragment>
  );
}

export default App;
